import { useState } from "react/cjs/react.development";

function UserInput() {
  var name, mainPrices = [];
  var pricing = [];
  const [prices, setPrice] = useState();
  function onChangeHandler(event) {
    name = event.target.value;
  }
  function onClickHandler(event) {
    event.preventDefault();
      fetch('https://www.alphavantage.co/query?function=TIME_SERIES_MONTHLY&symbol=IBM&apikey=HIOOYZ15LELZLW0A').then(response => {
          return response.json();
      }).then((data) => {
       pricing = data['Monthly Time Series'];
       mainPrices[0] = pricing['2018-01-31']['1. open'];
       mainPrices[1] = pricing['2019-01-31']['1. open'];
       mainPrices[2] = pricing['2020-01-31']['1. open'];
       console.log(pricing.indexOf(1));
       console.log(mainPrices[0]);
       console.log(mainPrices[1]);
       console.log(mainPrices[2]);
       console.log(mainPrices[3]);
      });
  }
  return (
    <div>
      <form>
        <input className = "inputValue" type="text" placeholder="Enter city name" onChange = {onChangeHandler}></input>
        <button onClick = {onClickHandler} >
          Submit!
        </button>
        <h1>Celsius:{prices}</h1>
      </form>
    </div>
  );
}

export default UserInput;
